    @Test
    @Transactional
    public void createCassetta() throws Exception {
        int databaseSizeBeforeCreate = cassettaRepository.findAll().size();

        // Create the Cassetta

        restCassettaMockMvc.perform(post("/api/cassettas")
                .contentType(TestUtil.APPLICATION_JSON_UTF8)
                .content(TestUtil.convertObjectToJsonBytes(cassetta)))
                .andExpect(status().isCreated());

        // Validate the Cassetta in the database
        List<Cassetta> cassettas = cassettaRepository.findAll();
        assertThat(cassettas).hasSize(databaseSizeBeforeCreate + 1);
        Cassetta testCassetta = cassettas.get(cassettas.size() - 1);
        assertThat(testCassetta.getCodiceCassetta()).isEqualTo(DEFAULT_CODICE_CASSETTA);
        assertThat(testCassetta.getOdl()).isEqualTo(DEFAULT_ODL);
        assertThat(testCassetta.getRifGeografo()).isEqualTo(DEFAULT_RIF_GEOGRAFO);
        assertThat(testCassetta.isPrioritario()).isEqualTo(DEFAULT_PRIORITARIO);
        assertThat(testCassetta.getIndirizzoScavo()).isEqualTo(DEFAULT_INDIRIZZO_SCAVO);
        assertThat(testCassetta.getDenomCantiere()).isEqualTo(DEFAULT_DENOM_CANTIERE);
        assertThat(testCassetta.getCodiceRdc()).isEqualTo(DEFAULT_CODICE_RDC);
        assertThat(testCassetta.getDataScavo()).isEqualTo(DEFAULT_DATA_SCAVO);
        assertThat(testCassetta.getCoordGpsN()).isEqualTo(DEFAULT_COORD_GPS_N);
        assertThat(testCassetta.getCoordGpsE()).isEqualTo(DEFAULT_COORD_GPS_E);
        assertThat(testCassetta.getCoordX()).isEqualTo(DEFAULT_COORD_X);
        assertThat(testCassetta.getCoordY()).isEqualTo(DEFAULT_COORD_Y);
        assertThat(testCassetta.getCentroOperativo()).isEqualTo(DEFAULT_CENTRO_OPERATIVO);
        assertThat(testCassetta.getImpresaAppaltatrice()).isEqualTo(DEFAULT_IMPRESA_APPALTATRICE);
        assertThat(testCassetta.getIncaricatoAppaltatore()).isEqualTo(DEFAULT_INCARICATO_APPALTATORE);
        assertThat(testCassetta.getTecnicoItgResp()).isEqualTo(DEFAULT_TECNICO_ITG_RESP);
        assertThat(testCassetta.getNumCampioni()).isEqualTo(DEFAULT_NUM_CAMPIONI);
        assertThat(testCassetta.isPresenzaCampione10()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_10);
        assertThat(testCassetta.isPresenzaCampione11()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_11);
        assertThat(testCassetta.isPresenzaCampione12()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_12);
        assertThat(testCassetta.isPresenzaCampione13()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_13);
        assertThat(testCassetta.isPresenzaCampione14()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_14);
        assertThat(testCassetta.isPresenzaCampione15()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_15);
        assertThat(testCassetta.isPresenzaCampione16()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_16);
        assertThat(testCassetta.isPresenzaCampione17()).isEqualTo(DEFAULT_PRESENZA_CAMPIONE_17);
        assertThat(testCassetta.getStatoContenitore()).isEqualTo(DEFAULT_STATO_CONTENITORE);
        assertThat(testCassetta.getStatoAttualeCassetta()).isEqualTo(DEFAULT_STATO_ATTUALE_CASSETTA);
        assertThat(testCassetta.isContenutoInquinato()).isEqualTo(DEFAULT_CONTENUTO_INQUINATO);
        assertThat(testCassetta.isConglomeratoBituminoso()).isEqualTo(DEFAULT_CONGLOMERATO_BITUMINOSO);
        assertThat(testCassetta.getFotoContenitore()).isEqualTo(DEFAULT_FOTO_CONTENITORE);
        assertThat(testCassetta.getFotoContenitoreContentType()).isEqualTo(DEFAULT_FOTO_CONTENITORE_CONTENT_TYPE);
        assertThat(testCassetta.getFotoContenuto()).isEqualTo(DEFAULT_FOTO_CONTENUTO);
        assertThat(testCassetta.getFotoContenutoContentType()).isEqualTo(DEFAULT_FOTO_CONTENUTO_CONTENT_TYPE);
        assertThat(testCassetta.getMsSismicitaLocale()).isEqualTo(DEFAULT_MS_SISMICITA_LOCALE);
        assertThat(testCassetta.getMsValAccelerazione()).isEqualTo(DEFAULT_MS_VAL_ACCELERAZIONE);
        assertThat(testCassetta.getNote()).isEqualTo(DEFAULT_NOTE);
        assertThat(testCassetta.getCertificatoPdf()).isEqualTo(DEFAULT_CERTIFICATO_PDF);
        assertThat(testCassetta.getCertificatoPdfContentType()).isEqualTo(DEFAULT_CERTIFICATO_PDF_CONTENT_TYPE);
        assertThat(testCassetta.getNumProtocolloCertificato()).isEqualTo(DEFAULT_NUM_PROTOCOLLO_CERTIFICATO);

        // Validate the Cassetta in ElasticSearch
        Cassetta cassettaEs = cassettaSearchRepository.findOne(testCassetta.getId());
        assertThat(cassettaEs).isEqualToComparingFieldByField(testCassetta);
    }

