    @Test
    @Transactional
    public void deleteCassetta() throws Exception {
        // Initialize the database
        cassettaService.save(cassetta);

        int databaseSizeBeforeDelete = cassettaRepository.findAll().size();

        // Get the cassetta
        restCassettaMockMvc.perform(delete("/api/cassettas/{id}", cassetta.getId())
                .accept(TestUtil.APPLICATION_JSON_UTF8))
                .andExpect(status().isOk());

        // Validate ElasticSearch is empty
        boolean cassettaExistsInEs = cassettaSearchRepository.exists(cassetta.getId());
        assertThat(cassettaExistsInEs).isFalse();

        // Validate the database is empty
        List<Cassetta> cassettas = cassettaRepository.findAll();
        assertThat(cassettas).hasSize(databaseSizeBeforeDelete - 1);
    }

